"use client"

import { useState, useEffect } from "react"
import { Link } from "react-router-dom"
import { toast } from "react-toastify"
import { authAPI } from "../../services/api"
import Loader from "../../components/common/Loader"
import Modal from "../../components/common/Modal"
import Pagination from "../../components/common/Pagination"

const UserManagement = () => {
  const [users, setUsers] = useState([])
  const [loading, setLoading] = useState(true)
  const [currentPage, setCurrentPage] = useState(1)
  const [totalPages, setTotalPages] = useState(1)
  const [filter, setFilter] = useState("all")
  const [searchTerm, setSearchTerm] = useState("")
  const [showDeleteModal, setShowDeleteModal] = useState(false)
  const [userToDelete, setUserToDelete] = useState(null)

  useEffect(() => {
    fetchUsers()
  }, [filter, currentPage])

  const fetchUsers = async () => {
    setLoading(true)
    try {
      const response = await authAPI.getUsers()
      let filteredUsers = response.data.data || []

      // Apply role filter
      if (filter !== "all") {
        filteredUsers = filteredUsers.filter((user) => user.role === filter)
      }

      // Apply search if present
      if (searchTerm) {
        filteredUsers = filteredUsers.filter(
          (user) =>
            user.name.toLowerCase().includes(searchTerm.toLowerCase()) ||
            user.email.toLowerCase().includes(searchTerm.toLowerCase()) ||
            (user.institution && user.institution.toLowerCase().includes(searchTerm.toLowerCase())),
        )
      }

      setUsers(filteredUsers)
      setTotalPages(Math.ceil(filteredUsers.length / 10))
      setLoading(false)
    } catch (error) {
      console.error("Error fetching users:", error)
      toast.error("Failed to load users")
      setLoading(false)
    }
  }

  const handleFilterChange = (e) => {
    setFilter(e.target.value)
    setCurrentPage(1)
  }

  const handleSearch = (e) => {
    e.preventDefault()
    fetchUsers()
  }

  const handleSearchChange = (e) => {
    setSearchTerm(e.target.value)
  }

  const handlePageChange = (page) => {
    setCurrentPage(page)
  }

  const confirmDelete = (user) => {
    setUserToDelete(user)
    setShowDeleteModal(true)
  }

  const handleDeleteUser = async () => {
    if (!userToDelete) return

    try {
      await authAPI.deleteUser(userToDelete._id)
      toast.success("User deleted successfully")
      setShowDeleteModal(false)
      fetchUsers()
    } catch (error) {
      console.error("Error deleting user:", error)
      toast.error(error.response?.data?.message || "Failed to delete user")
    }
  }

  const formatDate = (dateString) => {
    const options = { year: "numeric", month: "long", day: "numeric" }
    return new Date(dateString).toLocaleDateString(undefined, options)
  }

  // Get current users for pagination
  const indexOfLastUser = currentPage * 10
  const indexOfFirstUser = indexOfLastUser - 10
  const currentUsers = users.slice(indexOfFirstUser, indexOfLastUser)

  if (loading) {
    return <Loader />
  }

  return (
    <div className="container py-4">
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h1>User Management</h1>
        <Link to="/admin/users/create" className="btn btn-primary">
          Create New User
        </Link>
      </div>

      <div className="card mb-4">
        <div className="card-body">
          <div className="row">
            <div className="col-md-6 mb-3 mb-md-0">
              <form onSubmit={handleSearch} className="d-flex">
                <input
                  type="text"
                  className="form-control me-2"
                  placeholder="Search users..."
                  value={searchTerm}
                  onChange={handleSearchChange}
                />
                <button type="submit" className="btn btn-outline-primary">
                  Search
                </button>
              </form>
            </div>
            <div className="col-md-6 d-flex justify-content-md-end">
              <select className="form-select" style={{ width: "auto" }} value={filter} onChange={handleFilterChange}>
                <option value="all">All Users</option>
                <option value="student">Students</option>
                <option value="examiner">Examiners</option>
                <option value="admin">Administrators</option>
              </select>
            </div>
          </div>
        </div>
      </div>

      {users.length === 0 ? (
        <div className="card p-4 text-center">
          <h3>No users found</h3>
          <p>Create your first user to get started.</p>
          <Link to="/admin/users/create" className="btn btn-primary mt-3">
            Create New User
          </Link>
        </div>
      ) : (
        <>
          <div className="table-responsive">
            <table className="table table-striped table-hover">
              <thead>
                <tr>
                  <th>Name</th>
                  <th>Email</th>
                  <th>Role</th>
                  <th>Institution</th>
                  <th>Joined Date</th>
                  <th>Actions</th>
                </tr>
              </thead>
              <tbody>
                {currentUsers.map((user) => (
                  <tr key={user._id}>
                    <td>{user.name}</td>
                    <td>{user.email}</td>
                    <td>
                      <span
                        className={`badge ${
                          user.role === "admin" ? "bg-danger" : user.role === "examiner" ? "bg-warning" : "bg-primary"
                        }`}
                      >
                        {user.role.toUpperCase()}
                      </span>
                    </td>
                    <td>{user.institution || "N/A"}</td>
                    <td>{formatDate(user.createdAt)}</td>
                    <td>
                      <div className="btn-group">
                        <Link to={`/admin/users/${user._id}/edit`} className="btn btn-sm btn-primary">
                          Edit
                        </Link>
                        <button className="btn btn-sm btn-danger" onClick={() => confirmDelete(user)}>
                          Delete
                        </button>
                      </div>
                    </td>
                  </tr>
                ))}
              </tbody>
            </table>
          </div>

          {totalPages > 1 && (
            <Pagination currentPage={currentPage} totalPages={totalPages} onPageChange={handlePageChange} />
          )}
        </>
      )}

      {/* Delete Confirmation Modal */}
      <Modal
        isOpen={showDeleteModal}
        onClose={() => setShowDeleteModal(false)}
        title="Confirm Delete"
        footer={
          <>
            <button className="btn btn-secondary" onClick={() => setShowDeleteModal(false)}>
              Cancel
            </button>
            <button className="btn btn-danger" onClick={handleDeleteUser}>
              Delete
            </button>
          </>
        }
      >
        <p>Are you sure you want to delete the user "{userToDelete?.name}"?</p>
        <p className="text-danger">This action cannot be undone.</p>
      </Modal>
    </div>
  )
}

export default UserManagement
